import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import './App.css';

import HomePage from './components/main page/HomePage';
import AccountPage from './components/account/AccountPage';
import CreateWorkoutsForm from './components/workouts/CreateWorkoutsForm';
import UserWorkouts from './components/workouts/UserWorkouts';
import SignIn from './components/Registration&Authentication/Login';
import PlansComp from './components/subscriptions/PlansComp';
import SignUp from './components/Registration&Authentication/SignUp';


function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  return (
    <>
      <div className='App'>

        <Router>
          <Routes>
            <Route
              path="/"
              element={<Navigate to="/home" />}
            />
            <Route path="/home" element={<HomePage isAuthenticated={isAuthenticated} />} />


            <Route path="/account" element={<AccountPage />} />
            <Route path='/create-workout' element={<CreateWorkoutsForm />}></Route>
            <Route path='/my-workouts' element={<UserWorkouts />}></Route>
            <Route path='/register' element={<SignUp />}></Route>
            <Route
              path='/login'
              element={<SignIn />}
            />
            <Route path='/plans/:planId' element={<PlansComp />}></Route>

          </Routes>
        </Router>

      </div>

    </>


  );
}

export default App;
